import React from "react"
import PropTypes from "prop-types"

class Apartments extends React.Component {
  render () {
    return (
      <React.Fragment>
      <div id="info">
          <h1>Apartment Info</h1>
          <div class="card card3 mb-3">
          <img src="https://images.unsplash.com/photo-1451153378752-16ef2b36ad05?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1047&q=80" class="card-img-top" alt="..."></img>
          <div class="card-body">
            <h5 class="card-title">Card title</h5>
            <p class="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
            <p class="card-text"><small class="text-muted">Last updated 3 mins ago</small></p>
          </div>
        </div>
      </div>
      </React.Fragment>
    );
  }
}

export default Apartments
